import { Component } from "react";
class Sachin2  extends Component
{
    constructor()
    {
        super()
        this.state=
        {data : "rahul",
         data1 : "sumit"
        }
    }
    change()
    {this.setState({data : "vivek"}),
     this.setState({data1 : "golu"})

}
render()
{
    return(
        <div>
            <h1>{this.state.data}</h1>
            <h1>{this.state.data1}</h1>
            <button onClick={()=>this.change()}>ok</button>
        </div>
    )
}
}
export default Sachin2
